import {Route} from 'react-router-dom'
import './styles/App.scss';
import Nav from './components/Nav/Nav.jsx';
import Home from './components/home/home'

function App() {

  return (
    <div className="App">
      <Route 
          path='/'
          render={()=> <Nav />}
      /> 
      <Route  
      exact path='/' 
      render={()=> <Home/>}
      /> 
      <Route
      exact path ='/ciudad/:ciudadId'
      render={ <Ciudad />}
      />
    </div>
  );
}

export default App;
